import axios from "axios";

async function createNewInvoice(invoiceState, lineItemState) {
  console.log(invoiceState, lineItemState);
  try {
    const res = await axios.post("http://localhost:4082/api/invoice", {
      invoiceState,
    });
    console.log(res.data);
  } catch (error) {
    console.log(error);
    return;
  }
}

export default createNewInvoice;
